import plusbtn from "../images/plusbutton.png"

const Waiting = () => {

	const [chatList, setChatList] = useState<{id:string, password:string, owner_id:string, num:number}[]>();
	useEffect(() => {
		//const res = await axios.get('')
		//setChatList(res.data)
		setChatList([{id:"chat_r1", password:"", owner_id:"oid1", num:1}, {id:"chat_r2", password:"", owner_id:"oid1", num:1}])
	})

	return (
	<div id="container">
		<span className="listLeft">
			<div className="list-box">
				<div className="listName">game +</div>
				{chatList?.map(chatRoom=>
					<div>{chatRoom.id}
